        };
    }
    render() {
        return (
            <div>
                 <ButtonGroup>
                            <DropdownButton as={ButtonGroup} title="Invoices" id="bg-nested-dropdown" variant="primary" size="lg" block>
                                <Dropdown.Item eventKey="1">View Invoice</Dropdown.Item>
                                <Dropdown.Item eventKey="2">Create Invoice</Dropdown.Item>
                            </DropdownButton>
                        </ButtonGroup>
            </div>
        )}}

